AntennaBitMap encoded as a bitmap, where bit Nb is set to "0" if an antenna path with Np = N-1 is not permit to calibration, and set to "1" if the antenna path with Np = N-1 is permitted to calibration; 
N = 1 to 8; bit 1 of the bitmap is the Least Significant Bit of the bit string. 
Np = 0 to 7; is the antenna path index
